const defaultSize = 24;

const useIconColor = (color?: string, isActive?: boolean): { blue: string; pink: string } => {
  const {
    colors: { blue: blueColor, pink: pinkColor },
  } = useTheme();

  const blue = useMemo(
    () => (isActive ? blueColor['700'] : color || blueColor['500']),
    [isActive, color, blueColor]
  );

  const pink = useMemo(
    () => (isActive ? pinkColor['500'] : color || blueColor['500']),
    [isActive, color, pinkColor, blueColor]
  );

  return {
    blue,
    pink,
  };
};

